import React, { useState } from 'react';
import { PrincipalPage } from '../../layout/principalPage';

export function NotificationsPage() {
  // Estado inicial das notificações
  const [notifications, setNotifications] = useState([
    { id: 1, text: 'User1 liked your post.', time: '2h ago' },
    { id: 2, text: 'User2 commented on your post.', time: '3h ago' },
    { id: 3, text: 'User3 started following you.', time: '5h ago' },
    // Adicione mais notificações conforme necessário
  ]);

  return (
    <PrincipalPage>
      <div className="container mx-auto p-4">
        <h1 className="text-2xl font-bold mb-4 text-white">Notificações</h1>
        <div className="space-y-4">
          {notifications.map(notification => (
            <div key={notification.id} className="bg-gray-800 p-4 rounded-md shadow-md">
              <p className="text-white">{notification.text}</p>
              <p className="text-gray-400 text-sm">{notification.time}</p>
            </div>
          ))}
        </div>
      </div>
    </PrincipalPage>
  );
}
